body {
    background-color: #000;
    display: flex;
    justify-content: center;
    align-items: flex-start;
    height: 100vh;
    gap: 20px;
    font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
    color: white;
}

.navigation {
    display: flex;
    border: solid rgb(0, 0, 0) 1px;
    background-color: #333;
    align-items: center;
    justify-content: center;
    gap: 15px;
    margin-left: 70%;
    height: 40px;
    text-decoration: none;
    color: white;
    position: absolute;
    top: 0;
    right: 0;
    left: 0;
    z-index: 1000;
    border-radius: 10px 0 0 10px;
    text-align: center;
    font-size: 20px;
    box-shadow: #000 1px 2px 3px;
    text-shadow: #000 1px 2px 3px;
}

.navigation a {
    display: flex;
    text-decoration: none;
    color: white;
}

.container-left, .container-right {
    background-color: #333;
    border: 1px solid black;
    border-radius: 10px;
    box-shadow: #000 1px 2px 3px;
    padding: 20px;
    position: relative;
}

.container-left {
    width: 20%;
    height: 10240px;
}

.container-right {
    width: 80%;
    height: 10240px;
}

.foto-perfil {
    border: solid white 1px;
    border-radius: 50%;
    width: 150px;
    height: 150px;
    object-fit: cover;
    display: block;
    margin: auto;
}

.nome {
    text-align: center;
    font-size: 20px;
    font-weight: bold;
    margin-top: 10px;
    text-shadow: #000 1px 2px 3px;
}

.linha {
    border: 1px solid black;
    margin: auto;
    width: 160px;
    margin-top: 40px;
    box-shadow: #000 1px 2px 3px;
}

.stack {
    border: solid #4d4c4c 1px;
    background-color: #333;
    border-radius: 17px;
    text-align: center;
    width: 175px;
    margin: auto;
    margin-top: 30px;
    color: white;
    box-shadow: #000 1px 2px 3px;
    text-shadow: #000 1px 2px 3px;
}

li {
    display: flex;
    margin-top: 50px;
    list-style: none;
    align-items: center;
    gap: 5px;
    font-family: Arial, Helvetica, sans-serif;
    font-weight: bold;
    margin-left: -29px;
    text-shadow: #000 1px 2px 3px;
}

#text {
    border: #4d4c4c solid 1px;
    border-radius: 10px;
    background-color: #333;
    box-shadow: #000 1px 2px 3px;
    width: 200px;
}

.contato {
    border: 1px solid #4d4c4c;
    border-radius: 8px;
    background-color: #383636;
    box-shadow: #000 1px 2px 3px;
}

h1 {
    color: rgb(212, 22, 22);
    margin-top: 0;
    font-family: Arial, Helvetica, sans-serif;
    font-style: normal;
    font-size: 30px;
    text-shadow: #000 1px 2px 3px;
}

.about {
    font-family: Arial, Helvetica, sans-serif;
    padding: 20px;
    text-align: justify;
}

.linha1 {
    display: flex;
    border: 1px solid black;
    width: 80px;
    box-shadow: #000 1px 2px 4px;
    margin-left: 0;
    margin-top: -10px;
}

.grid-iten {
    display: grid;
    grid-template-columns: repeat(3, 1fr);
    color: #000;
    gap: 20px;
    margin-top: 60px;
}

.grid-iten p {
    border: #4d4c4c 1px solid;
    height: 70px;
    text-align: center;
    padding-top: 7vh;
    border-radius: 15px;
    background-color: #333;
    color: white;
    text-shadow: #000 1px 2px 3px;
    box-shadow: #000 1px 2px 3px;
}

footer {
    background: #000;
    display: flex;
    flex-direction: column;
    align-items: center;
    position: relative;
}
